import React from "react";
import  {Avatar, Card, CardActions, CardContent, CardHeader, CardMedia, IconButton, Typography} from '@material-ui/core';
import MoreVertIcon from "@material-ui/icons/MoreVert";
import FavoriteIcon from "@material-ui/icons/Favorite";

export default function Post({post}){
    return <Card>
        <CardHeader 
        avatar = {<Avatar>A</Avatar>}
        title={post.author}
        subheader = {post.updatedAt}
        action={
            <IconButton>
               <MoreVertIcon/> 
            </IconButton>
        }
        />

        <CardMedia image = "" title="Title"/>
        <CardContent>
            <Typography variant='h5' color='textPrimary'>C'est le titre</Typography>
            <Typography variant='boby2' component="p" color='textSecondary'>C'est le contenu</Typography>
        </CardContent>

        <CardActions>
            <IconButton>
                <FavoriteIcon/>
                <Typography component="span" color="textSecondary">
                    10 likes
                </Typography>
            </IconButton>
        </CardActions>
    </Card>
}
